import React from "react";

const DUMMY_MEALS = [
  {
    id: "m1",
    name: "Sushi",
    description: "Finest fish and veggies",
    price: 22.99,
  },
  {
    id: "m2",
    name: "Schnitzel",
    description: "A german specialty!",
    price: 16.5,
  },
  {
    id: "m3",
    name: "Barbecue Burger",
    description: "American, raw, meaty",
    price: 12.99,
  },
  {
    id: "m4",
    name: "Green Bowl",
    description: "Healthy...and green...",
    price: 18.99,
  },
];

function AvailableMeals() {
  const mealsList = DUMMY_MEALS.map((meal) => <><div>
    <li>
    <p>{meal.name}</p>
    <p>{meal.description}</p>
    <p>{meal.price}</p>
  </li>
    </div>
    <div>
      <input type="number" step={1} m/>
    <button>add</button>
    </div>
    </>);
  return (
    <section>
      <ul>{mealsList}</ul>
    </section>
  );
}

export default AvailableMeals;
